import React from 'react'
import Mid from "./Mid";
import Carousel from "./Carousel";
import Form from "./Form";
import Venue from "./Venue";
import Footer from "./Footer";
import Youtube from "./Youtube";
import "..";


function Home() {
  return (
        <>
          <Venue />
            <div className="carousel">
              <Mid />
              <Carousel />
            </div>
            <Form />
            <Youtube />
            <Footer />
        </>
  )
}

export default Home
